import React, { Component } from "react";

class ShirtCard extends Component {
  render() {
    const carId = this.props.match.params.carId;
    const { cars } = this.props.location.state; // Access cars prop
    const car = cars.find(c => c._id === carId); // Find the specific car by ID

    return (
      <div>
        <h1>{car.name}</h1>
        <p>Car ID: {carId}</p>
        {/* Display car details here */}
      </div>
    );
  }
}

export default ShirtCard;
